import React from "react";
import "./App.css";
import axios from "axios";
import { useQuery } from "react-query";

const apiClient = axios.create({
  baseURL: "http://127.0.0.1:8080",
  headers: {
    "Content-type": "application/json",
  },
});

function App() {
  const { data, isLoading } = useQuery("getUser", async () => {
    const { data } = await apiClient.get(`/users`);
    console.log(data);
    return data;
  });

  return (
    <div className="App">
      {isLoading ? "loading..." :
        <ul>
          {
            data.map((d: { id: boolean | React.ReactChild | React.ReactFragment | React.ReactPortal | null | undefined; first_name: boolean | React.ReactChild | React.ReactFragment | React.ReactPortal | null | undefined; last_name: boolean | React.ReactChild | React.ReactFragment | React.ReactPortal | null | undefined; }) => {
              // eslint-disable-next-line react/jsx-key
              return <li>{d.id}, {d.first_name}, {d.last_name}</li>
            })
          }
        </ul>
      }
      <h1>Hello</h1>
    </div>
  );
}

export default App;
